// CRYPTOVOXELS script for ALAV's navigation
// For Nabi's parcel in the cryptovoxels platform
// Author: Aaron Moreno Ayala www.aaronmorenoayala.com

// This script is built as a step by step structure, to accommodate for the throttled Cryptovoxel animation API, where is not reasonable to set position on every frame to animate

// Each step calls an animation and then sets position to match the given animation

// This is script is calibrated to work on a 1000 milliseconds step, but you can try another value, lower values seem to be more prone to glitches
let stepTime = 700;

// Unused, calibration is done manually on parcelDimensions variable
// This is the size of the box that the alavs check, keep in mind that you also have to set the Y axis offset according to the floor where they are located
// const spaceDimensions = {x: 13, y: 3,z: 9};

// Minimun height alavs will fly on, AKA which floor are they located on
const Y_OFFSET_GLOBAL = 1;

// Radius where an ALAV will detect being close to another and begin pairing mode
const COLLISION_AREA = 2;

// Vertical distance between two ALAVs when they are paired
const PAIRED_Y_OFFSET = 0.25;

// The maximun range they can move on a given step
const RANGE = 0.6;

// Defines the chance of an ALAV changing direction in a step,
// this value works in an inverted manner!!
// 0 will make it change on every step
// 1 will be like fliping a coin
// 2 will make it change direction in a 1/3 of a chance ratio
const CHANGE_DIRECTION_FREQUENCY = 0

// the number of steps that the ALAV will stay in Paired mode, rotating
const PAIRING_STEPS = 5;

// The number of steps where the ALAV can move again after pairing state and not check for other alavs, 
// so it can have some time to get away and not enter in paired state
const LEAVING_STEPS = 7;

// The number of steps after which an ALAV will stop moving randomly and choose another ALAV to chase and pair
// If set to zero, this behaviour will be ignored, this is useful for big spaces when it takes too much time for two alavs to encounter each other
const MOVING_STEPS = 10;

// between 0.1 and 1. the proportion of a step that will spent rotating 
const ROTATION_RATE = 0.7
// PUT THE LIST OF ALAV IDS HERE, SEPARATED BY COMMA
// any alav that is not listed here will not move or interact
// any id that is non existent will be skipped and logged into the console
let alavIds = ['alav3', 'alav4']; 

// Set the high and low limits for each axis, calibrate with a empty vox model on the limits, and check position for each axis
let parcelDimensions ={highLimit:{'x':0.95,'y':2.5,'z':-0.65}, lowLimit: {'x':-5,'y':1,'z':-7.8}};

// Global variables that get set automatically from the script, would be wise to leave unchanged
let frames = 30;
let interval = 500;
let timeoutA;
let timeoutB;
let arrayCount = 0;

function setValuesForSteps(stepTime){
    interval = stepTime/2;
    if(stepTime === 1000){
        frames = 30;
    } else {
        frames = (30*interval)/500;
    }
}

function calculateSpaceLimits(spaceDimensions){
    let finalDimensions ={highLimit:new Vector3(0,0,0), lowLimit: new Vector3(0,0,0)}
    let xOffset = spaceDimensions.x/2;
    let zOffset = spaceDimensions.z/2;
    finalDimensions.highLimit.x = xOffset;
    finalDimensions.lowLimit.x = -xOffset;

    finalDimensions.highLimit.z = zOffset;
    finalDimensions.lowLimit.z = -zOffset;

    finalDimensions.highLimit.y = spaceDimensions.y + Y_OFFSET_GLOBAL;
    finalDimensions.lowLimit.y = Y_OFFSET_GLOBAL;
    return finalDimensions
}

function createAlavFeatures(idArray){
    let alavArray = [];
    for(let id of idArray){
        let newAlav = parcel.getFeatureById(id);
        if(newAlav === undefined){
            console.log('alav id not found', id);
        } else {
            let animationPos = newAlav.createAnimation('position');
            let animationRot = newAlav.createAnimation('rotation');
            alavArray.push({
                feature: newAlav, 
                animation: {pos:animationPos, rot: animationRot}, 
                target: {pos: new Vector3(0,0,0), rot:new Vector3(0,0,0)}, 
                state: 'moving', 
                pairingCount: 0,
                leavingCount: 0,
                movingCount: 0
            });
        }
    }
    return alavArray;
}

let alavArray = createAlavFeatures(alavIds);

startSteps();

function startSteps(){
    setValuesForSteps(stepTime);
    // parcelDimensions = calculateSpaceLimits(spaceDimensions);
    step1();
}

function animateAlav(alav){
    alav.animation.pos.setKeys([{
        frame: frames,
        value: alav.feature.position.add( alav.target.pos ),
    }]);
    alav.animation.rot.setKeys([{
        frame: frames*ROTATION_RATE,
        value: alav.feature.rotation.add( alav.target.rot ),
    }]);
    alav.feature.startAnimations([alav.animation.pos, alav.animation.rot]);
}



function checkForCollisions(index1){
    for(let index2 in alavArray){
        if(index1 != index2 
            && (alavArray[index1].state === 'moving' || alavArray[index1].state === 'chasing') 
            && (alavArray[index2].state === 'moving' || alavArray[index1].state === 'chasing')
            ){
            let alav1 = alavArray[index1];
            let alav2 = alavArray[index2];
            let alavsColliding = comparePositions(alav1.feature.position, alav2.feature.position);
            if(alavsColliding && alav1.pairingCount === 0 && alav2.pairingCount === 0 ){
                alavArray[index1].target.pos = getMiddlePointDistance(alav1.feature.position, alav2.feature.position);
                alavArray[index2].target.pos = getMiddlePointDistance(alav2.feature.position, alav1.feature.position);
                alavArray[index1].target.pos.y = alavArray[index1].target.pos.y + PAIRED_Y_OFFSET;
                alavArray[index1].state = 'pairing';
                alavArray[index2].state = 'pairing';
            }
        }
    }
}

function getMiddlePointDistance(pos1, pos2){
    let finalVector = new Vector3(0,0,0);
    Object.entries(pos1).forEach(([key, value])=>{
        finalVector[key] = pos2[key] - pos1[key]
    });
    return finalVector;
}

function getChasingVector(pos1, pos2){
    let finalVector = new Vector3(0,0,0);
    Object.entries(pos1).forEach(([key, value])=>{
        finalVector[key] = pos2[key] - pos1[key];
        if(finalVector[key] > RANGE){
            finalVector[key] = RANGE;
        } else if(finalVector[key] < -RANGE){
            finalVector[key] = -RANGE;
        }
    });
    return finalVector;
}

function getAwayVector(pos1, pos2){
    let finalVector = new Vector3(0,0,0);
    Object.entries(pos1).forEach(([key, value])=>{
        finalVector[key] = pos1[key] - pos2[key]
    });
    return finalVector;
}

function comparePositions(pos1, pos2){
    let a = COLLISION_AREA;
    let b = 0;
    Object.entries(pos1).forEach(([key, value])=>{
        let x = pos1[key] - pos2[key];
        x = x*x; 
        b += x;
    });
    if(b<a){
        return true;
    } else {
        return false
    }
}

function step1(){
    for(let index in alavArray){
        switch(alavArray[index].state){
            case 'paired':
                if(alavArray[index].pairingCount % 2){
                    alavArray[index].target.rot = new Vector3(0,3.14,0);
                } else {
                    alavArray[index].target.rot = new Vector3(0,-(3.14),0);
                }
                alavArray[index].pairingCount++
                if(alavArray[index].pairingCount > PAIRING_STEPS){
                    alavArray[index].pairingCount = 0;
                    alavArray[index].state = 'leaving';
                }
                break;
            case 'pairing':
                alavArray[index].target.pos = new Vector3(0,0,0);
                alavArray[index].target.rot = new Vector3(0,0,0);
                alavArray[index].state = 'paired';
                break;
            case 'leaving':
                alavArray[index].target.rot = new Vector3(0,0,0);
                let posVector = getRandomVector(alavArray[index].feature.pos);
                posVector = checkForLimitsOnTarget(alavArray[index].feature, posVector);
                alavArray[index].target.pos = posVector;
                alavArray[index].leavingCount++
                if(alavArray[index].leavingCount > LEAVING_STEPS){
                    alavArray[index].leavingCount = 0;
                    alavArray[index].state = 'moving';
                }
                break;
            case 'moving':
                if(Math.round(Math.random()*CHANGE_DIRECTION_FREQUENCY) === 0){
                    let posVector = getRandomVector(alavArray[index].feature);
                    posVector = checkForLimitsOnTarget(alavArray[index].feature, posVector);
                    alavArray[index].target.pos = posVector;
                    alavArray[index].target.rot = getTargetAngle(alavArray[index].feature, alavArray[index].target.pos);
                } else {
                    alavArray[index].target.pos = checkForLimitsOnTarget(alavArray[index].feature ,alavArray[index].target.pos);
                    alavArray[index].target.rot = new Vector3(0,0,0);
                }
                alavArray[index].movingCount++
                if(alavArray[index].movingCount > MOVING_STEPS && MOVING_STEPS != 0){
                    alavArray[index].movingCount = 0;
                    alavArray[index].state = 'chasing';
                }
                break;
            case 'chasing':
                let randomAlav = alavArray[Math.floor(Math.random()*alavArray.length)];
                alavArray[index].target.pos = getChasingVector(alavArray[index].feature.position, randomAlav.feature.position);
                break;
        }
        checkForCollisions(index);
        animateAlav(alavArray[index]);
    }
    timeoutA = setTimeout(()=>{(step2())}, interval)
}

function step2(){
    for(let alav of alavArray){
        moveAlav(alav.feature, alav.target);
    }
    timeoutB = setTimeout(step1, interval);
}
function checkForLimitsOnTarget(alav, target){
    Object.entries(target).forEach(([key, value])=>{
        if(alav.position[key]+value > parcelDimensions.highLimit[key] || alav.position[key]+value < parcelDimensions.lowLimit[key]){
            target[key] = -target[key];
        }
    })
    return target;
}
function getTargetAngle(alavFeature, target){
    let dis1 = alavFeature.position.y - target.y;
    let dis2 = alavFeature.position.z - target.z;
    let dis3 = alavFeature.position.x - target.x;
    let disFinal1 = Math.sqrt((dis3*dis3)+(dis2*dis2));
    let disFinal2 = Math.sqrt((dis3*dis3)+(dis2*dis2));
    let angle1 = Math.cos(dis3/disFinal1);
    let angle2 = Math.cos(dis3/disFinal2);

    if(Math.round(Math.random()) === 1){
        angle1 = -angle1
    }
    let finalAngleVector = new Vector3(0,(angle1)*(3.14/4),0);
    return finalAngleVector;
}

function moveAlav(alav, target){
    Object.entries(target.pos).forEach(([key, value])=>{
        if(alav.position[key]+value > parcelDimensions.highLimit[key]){
            alav.position[key] = parcelDimensions.highLimit[key];
        }
        if(alav.position[key]+value < parcelDimensions.lowLimit[key]){
            alav.position[key] = parcelDimensions.lowLimit[key];
        } else {
            alav.position[key] = alav.position[key] + target.pos[key]
        }
        alav.rotation[key] = alav.rotation[key] + target.rot[key]

    })
}
function getRandomVector(){
    let target = new Vector3((Math.random()*(RANGE*2))-RANGE, (Math.random()*(RANGE*2))-RANGE, (Math.random()*(RANGE*2))-RANGE);
    return target;
}

