function checkForLimitsOnTarget(alav, target){
    Object.entries(target).forEach(([key, value])=>{
        if(alav.position[key]+value > parcelDimensions.highLimit[key] || alav.position[key]+value < parcelDimensions.lowLimit[key]){
            target[key] = -target[key];
        }
    })
    return target;
}
function getTargetAngle(alav, target){
    let angle = Math.atan2(alav.feature.position.z - target.z, alav.feature.position.x - target.x)
    angle = Math.PI / -2 - angle
    angle = angle - Math.PI/2; // quarter rotation cause model is set like that
    return new Vector3(0, angle - alav.feature.rotation.y, 0);
}

function moveAlav(alav, target){
    Object.entries(target.pos).forEach(([key, value])=>{
        if(alav.position[key]+value > parcelDimensions.highLimit[key]){
            alav.position[key] = parcelDimensions.highLimit[key];
        }
        if(alav.position[key]+value < parcelDimensions.lowLimit[key]){
            alav.position[key] = parcelDimensions.lowLimit[key];
        } else {
            alav.position[key] = alav.position[key] + target.pos[key]
        }
        alav.rotation[key] = alav.rotation[key] + target.rot[key]

    })
}
function getRandomVector(){
    let target = new Vector3((Math.random()*(RANGE*2))-RANGE, (Math.random()*(RANGE*2))-RANGE, (Math.random()*(RANGE*2))-RANGE);
    return target;
}

function getHorizontalVector(alavFeature, y){
    let x, z;
    if(alavFeature.rotation.x !== 0){
        x =  -alavFeature.rotation.x;
    }
    if(alavFeature.rotation.z !== 0){
        z =  -alavFeature.rotation.z;
    }
    if(y){
        return new Vector3(x, y, z);
    } else {
        return new Vector3(x, alavFeature.rotation.y, z);
    }
}

